import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom'; // Import Router and Route
import './App.css';
import Landing from "./components/routes/landing/Landing";
import CreatePost from "./components/routes/createPost/CreatePost";

function App() {
    return (
        <Router> {/* Wrap your routes with the Router component */}
            <Route path="/" exact component={Landing} /> {/* Use Route instead of Switch */}
            <Route path="/create-post" component={CreatePost} /> {/* Use Route instead of Switch */}
        </Router>
    );
}

export default App;
